function PeopleList() {

    const people = [
      { id: 1, name: 'anh A', age: 18 },
      { id: 2, name: 'anh B', age: 19 },
      { id: 3, name: 'anh C', age: 20 },
    ];

    return (
      <div>
        <h1>Danh sách người</h1>
        <ul>
          {people.map((person) => (
            <li key={person.id}>
              {person.name} - {person.age} tuổi
            </li>
          ))}
        </ul>
      </div>
    );
  };

  export default PeopleList;
